script: |
  super -f text -I q4347.spq | sort > q4347.out

inputs:
  - name: q4347.spq
    data: |
      SELECT DISTINCT 73 / - + col2 col1 FROM tab0 (FORMAT parquet) WHERE NOT col0 + col0 * + col0 - - col2 - col2 * 11 IN ( + col1 );
  - name: tab0

outputs:
  - name: q4347.out
    data: |
      -1
      -7
      0
